import React from "react";

import Page1P1 from "../assets/projects/P1/home-screen-mobile-vetwise.png"
import Page2P1 from "../assets/projects/P1/create-account-screen-mobile-vetwise.png";
import Page3P1 from "../assets/projects/P1/navigation-screen-mobile-vetwise.png";
import Page4P1 from "../assets/projects/P1/choose-screen-mobile-vetwise.png";

const P4 = () => {
    return (
    <div className="project_container">

        <div className="img1">
        <img src={Page1P1} alt="Page P1"/>
        </div>

        <div className="img2">
        <img src={Page2P1} alt="Page P2"/>
        </div>

        <div className="img3">
        <img src={Page3P1} alt="Page P3"/>
        </div>

        <div className="img4">
        <img src={Page4P1} alt="Page P4"/>
        </div>

    </div>
    )
}

export default P4;
